class CategoryModel {  int? categoryId;  String? categoryName;  String? categoryNameAr;  String? categoryImage;  String? categoryDatetime;  CategoryModel(      {this.categoryId,        this.categoryName,        this.categoryNameAr,        this.categoryImage,        this.categoryDatetime});  CategoryModel.fromJson(Map<String, dynamic> json) {    categoryId = json['category_id'];    categoryName = json['category_name'];    categoryNameAr = json['category_name_ar'];    categoryImage = json['category_image'];    categoryDatetime = json['category_datetime'];  }}